import * as actionTypes from "./cardTypes";
const InitialState = {
  products: [],
  currentload: null,
};

const cardReducer = (state = InitialState, action) => {
  switch (action.type) {
    case actionTypes.CURRENT_LOAD:
      return {
        ...state,
        currentload: action.playload,
      };
    default:
      return state;
  }
};

export default cardReducer;
